import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Navbar from "./components/Navbar";
import Home from "../pages/Home";
import CadastroImovel from "../pages/CadastroImovel";
import Clientes from "../pages/Clientes";
import VisualizarCliente from "../pages/VisualizarCliente";
import CadastroCliente from "../pages/CadastroCliente";

const App = () => {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/comprar" element={<div>Comprar Page</div>} />
        <Route path="/vender" element={<CadastroImovel />} /> 
        <Route path="/alugar" element={<div>Alugar Page</div>} />
        <Route path="/corretores" element={<div>Corretores Page</div>} />
        <Route path="/clientes" element={<Clientes />} />
        <Route path="/clientes/novo" element={<CadastroCliente />} />
        <Route path="/clientes/:id" element={<VisualizarCliente />} />
      </Routes>
    </Router>
  );
};

export default App;
